import React from "react";
import './style.css';


function Sobre() {
    return(

        <section className="row">
             <div className="col-12 bg teste4">
            <h1 className="viajar">Escolha ps melhores destinos!<br /></h1>
            <h3><span class="destaque">Viaje + </span>tem os melhores destinos para a sua viagem cultural por um universo!</h3>
            </div>
        </section>
    )
}

export default Sobre;
